import React from "react";

const Tweet = ({ data }) => {
  const hashtags = () => {
    const hashtags = data.entities.hashtags
      .map(hashtag => hashtag.tag)
      .join(" ");
  };

  console.log(data);
  return (
    <div className="card">
      <div className="content">
        <div className="header">{hashtags}</div>
        <div className="meta">Some company</div>
        <div className="description">{data.text}</div>
      </div>
    </div>
  );
};

export default Tweet;
